    let firstName = "";
    let lastName = "";
    let email = "";
    let phone = "";
    let adress = "";
    // createUser = () => {
    //     let userToAdd = { identity, password, firstName, lastName, email, phone, adress };

    // }
    // console.log("aaaaaaa");
    
    return (


        <form>
            <div className="ui equal width form">
                <div className="fields">
                    <div className="field">
                        <label>Username</label>
